import request from '@/utils/request'; //评价单编制查询

export function queryRecord(query) {
  return request({
    url: "/SRMsupplier/evaluationSheet",
    method: 'get',
    params: query
  });
} //评价单编制明细查询

export function queryRecordItems(rowId) {
  return request({
    url: "/SRMsupplier/evaluationSheet/detail/".concat(rowId),
    method: 'get'
  });
} //评价单编制（新增）

export function addRecord(data) {
  return request({
    url: "/SRMsupplier/evaluationSheet/sheet/batch",
    method: 'post',
    data: data
  });
} //评价单编制（编辑）

export function updateRecord(rowId, data) {
  return request({
    url: "/SRMsupplier/supplierEvaluationPlan/".concat(rowId),
    method: 'patch',
    data: data
  });
} //评价单编制删除

export function deleteRecord(rowId) {
  return request({
    url: "/SRMsupplier/evaluationSheet/".concat(rowId),
    method: 'delete'
  });
} //评价单编制（提交）

export function submitRecord(data) {
  return request({
    url: "/SRMsupplier/supplierEvaluationPlan/commit",
    method: 'patch',
    data: data
  });
}
